import React, { useEffect, useState } from 'react';
import AppBar from '@mui/material/AppBar';
import { Box, Badge } from '@mui/material';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';
import computerLogo from '../../img/logo.png';
import { Link, useNavigate } from 'react-router-dom';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import RemoveShoppingCartIcon from '@mui/icons-material/RemoveShoppingCart';
import SearchInput from '../search/Search';
import { AUTH_ACTIONS, AuthState } from '../../context/AuthContext';
import './style.css';

const pages = ['Home', 'Products', 'Browse', 'Contact', 'Review'];
const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

function Header() {
    const [anchorElNav, setAnchorElNav] = useState(null);
    const [BasketNav, setBasketNav] = useState(null);

    const navigate = useNavigate()
    const { user, authDispatch } = AuthState();

    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
    };

    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
    };

    const handleOpenNavBasket = (event) => {
        setBasketNav(event.currentTarget);
    };

    const handleCloseNavBasket = () => {
        setBasketNav(null);
    };

    useEffect(() => {
        if (!user) {
            navigate('/login');
        }
    }, [])

    const handlelogincheck = () => {

    }

    return (
        <AppBar position="static" >
            <Container maxWidth="xl" className="appBar">
                <Toolbar disableGutters>
                    <Toolbar>
                        <Avatar component={Link} to="/" src={computerLogo} alt="IMG BOOKING" id="bookingLogo" />
                        <Typography
                            variant="h6"
                            noWrap
                            component={Link}
                            to="/"
                            sx={{
                                ml: 2,
                                mr: 2,
                                display: { sx: "none", md: 'flex' },
                                fontFamily: 'monospace',
                                fontWeight: 700,
                                letterSpacing: '.3rem',
                                color: 'inherit',
                                textDecoration: 'none',
                            }}
                        >
                            SpaceInfo
                        </Typography>
                    </Toolbar>

                    <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
                        {pages.map((page) => (
                            <Button
                                component={Link}
                                id='NavLink'
                                to={(page === "Contact" || page === "Review") && !user ? "/login" : page === 'Home' ? "/" : page}
                                key={page}
                                onClick={handleCloseNavMenu}
                                sx={{ my: 2, color: 'white', display: 'block', ml: 3, mt: 5 }}
                            >
                                {page}
                            </Button>
                        ))}
                    </Box>



                    <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
                        <IconButton
                            size="large"
                            aria-label="account of current user"
                            aria-controls="menu-appbar"
                            aria-haspopup="true"
                            onClick={handleOpenNavMenu}
                            color="inherit"
                        >
                            <MenuIcon />
                        </IconButton>
                        <Menu
                            id="menu-appbar"
                            anchorEl={anchorElNav}
                            anchorOrigin={{
                                vertical: 'bottom',
                                horizontal: 'left',
                            }}
                            keepMounted
                            transformOrigin={{
                                vertical: 'top',
                                horizontal: 'left',
                            }}
                            open={Boolean(anchorElNav)}
                            onClose={handleCloseNavMenu}
                            sx={{
                                display: { xs: 'block', md: 'none' },
                            }}
                        >
                            {pages.map((page) => (
                                <MenuItem key={page} onClick={handleCloseNavMenu}>
                                    <Typography
                                        textAlign="center"
                                        component={Link}
                                        id='NavLink'
                                        to={(page === "Contact" || page === "Review") && !user ? "/login" : page === 'Home' ? "/" : page}

                                        sx={{ mx: 5, my: 1, color: 'black', display: 'block', textDecoration: "none" }}
                                        onClick={handlelogincheck}
                                    >{page}</Typography>
                                </MenuItem>
                            ))}
                        </Menu>
                    </Box>

                    <IconButton color="inherit" sx={{mr:5}}>
                        <Badge badgeContent={5} color="secondary">
                            <ShoppingCartIcon onClick={handleOpenNavBasket} />
                        </Badge>
                    </IconButton>

                    <Box sx={{ mt: 2, display: { xs: 'none', md: 'inline-block' } }}>

                        {user ?
                            <React.Fragment>
                                <Button component={Link} to='/' color="error" variant='outlined' onClick={() => authDispatch({ type: AUTH_ACTIONS.LOGOUT })} sx={{ fontWeight: "bold" }} >Logout</Button>
                                <Button component={Link} to="/profile" color="success" variant='outlined' sx={{ fontWeight: "bold", ml: 2 }} >Profile</Button>

                            </React.Fragment>

                            :
                            <React.Fragment>
                                <Button variant='contained' color="primary" onClick={() => navigate("/login")} >Login</Button>
                                <Button variant='outlined' color="primary" onClick={() => navigate("/register")} sx={{ ml: 2 }}>Register</Button>
                            </React.Fragment>
                        }
                    </Box>

                </Toolbar>
                <SearchInput />
            </Container>
        </AppBar>
    );
}
export default Header;
